import React from 'react';
import ReactDOM from 'react-dom';

import {
  Route,
  NavLink,
  BrowserRouter
} from "react-router-dom";

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

function App() {
  return (
    <div className="App">
      <div>
      <BrowserRouter basename = "/">
        <Navbar expand="lg" style={{padding: "20px", backgroundImage:"linear-gradient(to right, #17a2b8 30%, #a31aff)"}} sticky='top'>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav>
            <NavLink style={{color:"white"}} className="navbar_entry" to="/">ACP</NavLink>
            <NavLink style={{color:"white"}} className="navbar_entry" to="/about">About</NavLink>
            <NavLink style={{color:"white"}} className="navbar_entry" to="/contact">Contact</NavLink>
            <NavLink style={{color:"white"}} className="navbar_entry" to="/howto">Blog</NavLink>
          </Nav>
        </Navbar.Collapse>
        </Navbar>

        <Route exact path="/" component={TestComponent} />
        <Route path="/about" component={TestComponent} />
        <Route path="/contact" component={TestComponent} />
        <Route path="/blog" component={TestComponent} />
      </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
